export default {
  name: 'PlaceDescription',
  props: ['title', 'map', 'placeid'],
  watch: {
    placeid: function placeid(newVal, oldVal) {
      var vm = this;
      console.log('W32 old ' + oldVal + ' new ' + newVal);

      if (newVal == null) {
        this.placeDetails = null;
      } else if (newVal) {
        var service = new window.google.maps.places.PlacesService(this.map);
        service.getDetails({
          placeId: this.placeid
        }, function (place, status) {
          if (status === window.google.maps.places.PlacesServiceStatus.OK) {
            vm.placeDetails = place;
          }
        });
      }
    }
  },
  data: function data() {
    return {
      placeDetails: null
    };
  },
  mounted: function mounted() {}
};
